void SpriteCode::DrawTileNumber(const Vec2i & pos, const int count, Graphics & gfx)
{
	assert(count >= 0 && count < 9);

	switch (count)
	{
	case 0:
		DrawTile0(pos, gfx);
		break;	
	case 1:
		DrawTile1(pos, gfx);
		break;	
	case 2:
		DrawTile2(pos, gfx);
		break;	
	case 3:
		DrawTile3(pos, gfx);
		break;	
	case 4:
		DrawTile4(pos, gfx);
		break;	
	case 5:
		DrawTile5(pos, gfx);
		break;	
	case 6:
		DrawTile6(pos, gfx);
		break;
	case 7:
		DrawTile7(pos, gfx);
		break;	
	case 8:
		DrawTile8(pos, gfx);
		break;	

	default:
		break;
	}

}


